@alenaschillerov @OECD @IMFNews @EU_Commission Pochopte to už, že krize minulá byla krizi poptávky. Tato krize je krizí nabídky. 
A každá pak potřebuje ke svému řešení jiné nástroje.
Nemá cenu dále lidem na dluh rozdávat peníze, když není nabídka. To samozřejmě zvyšuje inflaci. Moc peněz a málo zboží znamená vyšší ceny.

@alenaschillerov 1) Současná dramaticky uvolněná fiskální politika zbytečně přispívá k vysoké inflaci
2) Státní dluh se před krizí nezmenšoval. Stagnoval na 1,6 bilionů korun
3) Veřejné rozpočty nemíří se schodky v řádu 300-400 miliard ročně k postupné konsolidaci, ale k nárazu na dluhovou brzdu

